import React from "react";
import "./widgetsSm.css";

export default function WidgetsSm() {
  return (
    <div className="widgetSmall">
      <span className="widgetSmTitle">New Join Members</span>
      <ul className="widteSmList">
        <ul className="widgetSmListItem">
          <li className="widgetSmListItem">
            <img src="" alt="" />
            <div className="WidgetSmUser">
              <span className="widgetUsername"></span>
              <span className="widgetSmTitle">Software Engineer</span>
            </div>
            <button className="widgetSmButton"></button>
          </li>
        </ul>
      </ul>
    </div>
  );
}
